import './App.css';
import {
  createClient,
  dedupExchange,
  cacheExchange,
  fetchExchange,
  Provider,
} from 'urql';
import Questions from './Questions';

const client = createClient({
  url: 'http://localhost:8000/graphql/',
  exchanges: [dedupExchange, cacheExchange, fetchExchange],
});

function App() {
  return (
    <Provider value={client}>
      <Questions />
    </Provider>
  );
}

export default App;
